import { Contact } from "./pages/Contact";
import { NavBar } from "./cmps/NavBar";
import { Footer } from "./cmps/Footer";

export class App extends Component {
  render() {
    return (
      <div>
        <header>
          <NavBar />
        </header>
        <main>
          <Home />
        </main>
        <footer>
          <Footer />
        </footer>
      </div>
    );
  }
}
